import React from "react";
import HomePage from "./pages/homePage";

const App = () => {
 
  return( 
  <Router>
      <Routes>
      <Route path="/carriers">
        <Header/>
        <Carrier/>

      </Route>
      <HomePage />
      </Routes>
    </Router>);
};

export default App;
